class Solution(object):
    def minimumCost(self, source, target, original, changed, cost):
        """
        :type source: str
        :type target: str
        :type original: List[str]
        :type changed: List[str]
        :type cost: List[int]
        :rtype: int
        """
        if source == target:
            return 0

        change_cost = {}
        for o, c, co in zip(original, changed, cost):
            if (o, c) not in change_cost or change_cost[(o, c)] > co:
                change_cost[(o, c)] = co

        total_cost = 0
        for s, t in zip(source, target):
            if s != t:
                if (s, t) in change_cost:
                    total_cost += change_cost[(s, t)]
                else:
                    return -1

        return total_cost
